CREATE TABLE CENTRO (CCEN VARCHAR(6) PRIMARY KEY, NMCEN VARCHAR(100) NOT NULL);
CREATE TABLE GRUPO_INV (CGI VARCHAR(10) PRIMARY KEY, NOMBRE VARCHAR(100) NOT NULL, RESPONSABLE INTEGER NOT NULL, GRUPO_PRINC VARCHAR(10));
CREATE TABLE PROFESOR (CTG VARCHAR(7) NOT NULL, NOM VARCHAR(150) NOT NULL, CCEN VARCHAR(6) REFERENCES CENTRO (CCEN), NIP INTEGER PRIMARY KEY, DOCTOR VARCHAR(1) NOT NULL, HDED FLOAT NOT NULL, AREA VARCHAR(4) NOT NULL, GRUPO_INV VARCHAR(10));
/* ALTER TABLE GRUPO_INV ADD FOREIGN KEY (RESPONSABLE) REFERENCES PROFESOR (NIP); */
CREATE TABLE TITULACION (CTIT VARCHAR(6) PRIMARY KEY, NOMTIT VARCHAR(150) NOT NULL);
CREATE TABLE UDOCENTE (UDO VARCHAR(3) PRIMARY KEY, NUDOC VARCHAR(40) NOT NULL, RESP INTEGER NOT NULL REFERENCES PROFESOR (NIP));
CREATE TABLE ASIGNATURA (CCEN VARCHAR(6) NOT NULL REFERENCES CENTRO (CCEN), CTIT VARCHAR(6) NOT NULL REFERENCES TITULACION (CTIT), CU VARCHAR(2), NMASG VARCHAR(120) NOT NULL, UDO VARCHAR(3) NOT NULL REFERENCES UDOCENTE (UDO), CARACTER VARCHAR(2), GT INTEGER, GP INTEGER, CT FLOAT, CP FLOAT, NALM INTEGER, AREA VARCHAR(4), RESP INTEGER REFERENCES PROFESOR (NIP), COD_ASG INTEGER PRIMARY KEY);
CREATE TABLE DOCENCIA (GTP FLOAT NOT NULL, GPP FLOAT, NIP INTEGER REFERENCES PROFESOR (NIP), COD_ASG INTEGER REFERENCES ASIGNATURA (COD_ASG), PRIMARY KEY(NIP, COD_ASG));







